USE planningpoker;

CREATE TABLE `story_votes` (
  `story_id` int(11) NOT NULL,
  `participant_email` varchar(50) NOT NULL,
  `vote_points` int(11) DEFAULT NULL,
  PRIMARY KEY (`story_id`,`participant_email`),
  KEY `participant_email_fk` (`participant_email`),
  CONSTRAINT `participant_email_fk` FOREIGN KEY (`participant_email`) REFERENCES `participant` (`email`),
  CONSTRAINT `story_id_fk` FOREIGN KEY (`story_id`) REFERENCES `stories` (`story_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


